sys_variable_value.value:
(function execute(inputs, outputs) {
    var properties = ["x_rhtpp_eda.check_incident_created",
                 "x_rhtpp_eda.check_incident_state",
                 "x_rhtpp_eda.check_problem_created",
                 "x_rhtpp_eda.check_problem_state",
                 "x_rhtpp_eda.check_request_created",
                 "x_rhtpp_eda.check_request_state",
                 "x_rhtpp_eda.check_request_approved",
                 "x_rhtpp_eda.mid_server",
                 "x_rhtpp_eda.webhook_token",
                 "x_rhtpp_eda.webhook_url"];
    if (properties.indexOf(inputs.property_name) > -1) {
		if (inputs.property_value == null || inputs.property_value == "null") {
			inputs.property_value = "";
		}
        gs.setProperty(inputs.property_name, inputs.property_value);
    }
})(inputs, outputs);

